    false,nt"url": null,nt"notes": "The purpose of this study is to determine
    the response of nongame birds and small mammals to the refuge's grassland management
    practices of grazing and prescribed burning. Such information provides a database
    to guide decisions regarding the refuge 's grassland management. Preliminary work
    u00a3or this study was begun in 1987 and full-scale data collection was done in
    1988 and 1989. Work has been done by one seasonal Biological Technician each year
    with the help of one volunteer in 1988 and two volunteers in 1989. Data was collected
    from May through July in 1987 and May through September in 1988 and 1989. Red Rock
    Lakes has a unique situation compared to most other refuges because of its elevation
    and extreme climate. In particular, grassland management must deal with the effects
    of deep snow packs, very late springs, and cool, short summers. These climatological
    factors mat down much of the nesting cover, keep the ground frozen into May and
    June, suppress new vegetative growth, retard decomposition of litter and delay both
    invertebrate and vegetative production. These considerations necessitate special
    management approaches.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
